import { React, useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
const Provjera = () => {
  let { id } = useParams();
  const [data, setData] = useState();
  const [isLoading, setIsloading] = useState(true);
  useEffect(async () => {
    axios
      .get(`http://localhost:5000/kategorije/provjere/${id}`)
      .then((res) => {
        //let provjera = res.data;
        setData(res.data);
        setIsloading(false);
        console.log("provjera", data[0].provjere);
        // let provjera1 = provjera[0].provjere.filter((p) => {
        //   return p._id.includes(id);
        // });
        // setData(provjera1);
        //console.log("data provjera: ", data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div>
      <h1>Provjera</h1>
      {!isLoading &&
        data[0].provjere.filter((p) =>
          p._id.includes(id).map((a) => <h1>{a}</h1>)
        )}
    </div>
  );
};

export default Provjera;
